import React from "react";
import "./style.css";
import { useNavigate } from "react-router-dom";


function Header() {

  let navigate = useNavigate();
  function handleClick() {
    navigate("/home");
  }
  return (
    <div>
      <button onClick={handleClick}>go home</button>
    </div>
  );

}

export default Header;
